import './styles/App.css';
import react from 'react';
import { BellFill, PersonFill, HouseFill, CalendarDateFill, StickyFill } from 'react-bootstrap-icons'

class App extends react.Component {

  constructor(props) {
    super(props)
    this.iconSize = 20;
  }

  render() {
    return (
      <div className="app">
        <header className="container header-container">
          <nav className="navbar row d-flex">
            <div className="col-2 navbar-left">
              <h4>JOURNALY</h4>
            </div>
            <div className="col-8 navbar-mid">
              <form className="d-flex">
                <input className="form-control search-bar" placeholder="Search" a />
              </form>
            </div>
            <div className="col-2 navbar-right">
              <BellFill className="nav-icons" size={this.iconSize} />
              <PersonFill className="nav-icons" size={this.iconSize} />
            </div>
          </nav>
        </header>
        <main>
          <div className="container main-container">
            <div className="row main-row">
              <div className="col-2 mx-2 menu-container">
                <div className="menu">
                  <div className="menu-icons-container">
                    <HouseFill className="menu-icons" size={this.iconSize} />
                  </div>
                  <div className="menu-icons-container">
                    <CalendarDateFill className="menu-icons" size={this.iconSize} />
                  </div>
                  <div className="menu-icons-container">
                    <StickyFill className="menu-icons" size={this.iconSize} />
                  </div>
                </div>
              </div>

              <div className="col-2 mx-2 lists-container">
                <List />
                <List />
                <List />
                <List />
                <List />
                <List />
                <List />
                <List />
              </div>

              <div className="col-8 journal-container">

              </div>
            </div>
          </div>
        </main>
      </div >
    );
  }
}


class List extends react.Component {
  // constructor(props) {
